import React from 'react';
import { Card } from 'antd';
const WeatherIndex = () => {
  return (
    <div>
      <Card hoverable>
        <Card.Meta
          title="天氣預報"
          description="burger with tomato and onion"
        />
      </Card>
    </div>
  ) 
}

export default WeatherIndex
